('bd086a68-37ce-4dce-b6e9-3c77929aab73', '02d8e53b-fea7-410e-b2d2-938cc61627de', 'Earth Observation Data Service Manager', 'f2601046-ce81-48ef-8e14-db89efcd7aa6', 'Frascati, IT', 'Location ESRIN, Frascati, Italy Description Earth Observation Data Service Manager in the Common Services Section, Ground Segment and Data Management Division, Earth Observation Mission Management and Ground Segment Department, Directorate of Earth Observation Programmes. ESA is responsible for preparing the operations and subsequently operating the flying EO Science missions (including Earth Explorer and Earth Watch) and the Heritage missions at the required level of performances in line with mission requirements, adopting the most suitable technical, operational and management approach to maximise the missions’ scientific impact and the benefits for the user community. ESA is also responsible for granting access to authorised users to selected data collections from Third Party missions and for related ad-hoc operational activities. Operational activities for EO data generation and management rely on a flexible and resilient industrial service-based architecture which is in the process of evolving from a rather vertical, mission-specific Payload Data Ground Segments (PDGS) architecture to a single data generation and management environment (the Earth Observation Framework) aimed at maximising operational efficiency through streamlined interfaces while highlighting the uniqueness of each EO science mission thanks to ad-hoc developed elements (notably in the processing and in the data quality domain). Data Generation and Management services under the responsibility of the Common Services section include: User Services (Service Desk) and Information Portal Data and Information Management, Discovery and Access services Data Archiving, Consolidation and (Re-)Processing services Data Preservation services Advanced services for the development and processing of collaborative EO products Reporting to the Head of the Common Services Section, You will be responsible for the preparation, procurement, operations and evolution of one or more data generation and management services within the EO Framework. Duties Your tasks and responsibilities will include: defining service requirements by collecting user needs from different internal stakeholders and customers (Mission Managers / Ground Segment Managers / other Services Managers) and the scientific user community; based on the above, identifying gaps and preparing a plan for the evolution of impacted services under your responsibilities, preparing all the required contractual documentation and organising the necessary procurement actions in a way that ensures coherence, standardisation and cost effectiveness; managing the services’ implementation, transferring to operations and operational provision in line with the applicable Service Level Agreement, defining and implementing risk mitigation actions whenever necessary; providing regular operational, financial and industrial reporting on these services, including statistics reflecting service metrics and user behaviour; contributing to the overall Common Services Portfolio by including: risk management process specific to the managed services; compliance of the service to ESA Security and Data Protection policies; compliance with and execution of configuration and change management control processes; monitoring and reporting on end-to-end process performance for the entire Earth Observation Framework and proposing consequent areas for improvement. generating and maintaining the necessary management, technical and operational documentation; contributing actively to the definition and deployment of innovative and scalable technological solutions, notably in the IT domain, and operational concepts within the context of the EO Framework; providing metrics, user surveys and/or recommendations from international forums, to support management decision making on the implementation and deployment of appropriate means (e.g. platforms) for data preservation, processing, analysis and sharing; assisting the Head of the Common Services Section in other tasks (including audits and support to other projects within and outside the EOP-G Department"), as required. Technical competencies Sound knowledge of data generation, preservation and management systems with associated IT solutions for Earth observation missions Substantial experience relating to the design, implementation and operations of large-scale/high performance data infrastructures (data lake, datawarehouse, etc.), cloud architectures and virtualisation technologies (VMware, RedHat,…)Familiarity with SecDevOps principles and associated automation tools (like Terraform, Puppet Ansible)Good understanding of network architectures (LAN, WAN, VPN) and protocolsGood understanding of Artificial intelligence and machine learning technologies/algorithmsBackground in software engineering and programming languages, data analysis and BI toolsProven experience in technical project and service managementKnowledge of procurement processesBehavioural competencies Result Orientation Operational Efficiency Fostering Cooperation Relationship Management Continuous Improvement Forward Thinking For more information, please refer to ESA Core Behavioural Competencies guidebook Education A masters in a relevant engineering subject (software engineering, data engineering or ICT engineering) is required for this post Additional requirements A PMP/ITIL certification is considered an asset You should also: be able to work effectively and with a good degree of autonomy in an international and interdisciplinary team have a high level of motivation and dedication demonstrate experience in designing architectures based on modern and scalable ICT cloud-based solutions responding to performance, security and data protection principles applied to operational services have an overall system view, and a capacity to propose solutions within a broader, strategic perspective demonstrate flexibility in dealing with an evolving EO landscape and its technical and operational challenges Knowledge of innovative technologies and operational approaches for scientific payload data processing is considered an asset Diversity, Equity and Inclusiveness ESA is an equal opportunity employer, committed to achieving diversity within the workforce and creating an inclusive working environment. We therefore welcome applications from all qualified candidates irrespective of gender, sexual orientation, ethnicity, beliefs, age, disability or other characteristics. Applications from women are encouraged. At the Agency we value diversity, and we welcome people with disabilities. Whenever possible, we seek to accommodate individuals with disabilities by providing the necessary support at the workplace. The Human Resources Department can also provide assistance during the recruitment process. If you would like to discuss this further, please contact us via email at contact.human.resources@esa.int. Important Information and Disclaimer In principle, recruitment will be within the advertised grade band (A2-A4). However, if the selected candidate has less than four years of relevant professional experience following the completion of the master’s degree, the position may be filled at A1 level. During the recruitment process, the Agency may request applicants to undergo selection tests. Additionally, successful candidates will need to undergo basic screening before appointment, which will be conducted by an external background screening service, in compliance with the European Space Agencys security procedures. Note that ESA is in the process of transitioning to a Matrix setup, which could lead to organisational changes affecting this position. The information published on ESA’s careers website regarding working conditions is correct at the time of publication. It is not intended to be exhaustive and may not address all questions you would have. Nationality and Languages Please note that applications are only considered from nationals of one of the following States: Austria, Belgium, Czechia, Denmark, Estonia, Finland, France, Germany, Greece, Hungary, Ireland, Italy, Luxembourg, the Netherlands, Norway, Poland, Portugal, Romania, Slovenia, Spain, Sweden, Switzerland, the United Kingdom and Canada, Latvia, Lithuania and Slovakia. According to the ESA Convention, the recruitment of staff must take into account an adequate distribution of posts among nationals of the ESA Member States*. When short-listing for an interview, priority will first be given to internal candidates and secondly to external candidates from under-represented Member States*. The working languages of the Agency are English and French. A good knowledge of one of these is required. Knowledge of another Member State language would be an asset. *Member States, Associate Members or Cooperating States.', '2025-03-03 00:00:00+00', '2025-03-24 00:00:00+00', '2025-03-12 08:40:29.789234+00', '2025-03-17 06:05:15.359465+00', '2025-03-12 08:40:29.789234+00', 'draft', 'https://jobs.esa.int/job/Frascati-Earth-Observation-Data-Service-Manager/1177307501/', null, null, 'Permanent', null),
