('ed2e762a-8d03-47de-99e9-9a1010bb7153', '09581a23-f828-4061-81fa-097f05fdaec9', 'Head of the Satellite Programmes Department', 'f2601046-ce81-48ef-8e14-db89efcd7aa6', 'Noordwijk, NL', 'Location ESTEC, Noordwijk, Netherlands Description As Head of the Satellite Programmes Department, you will report to the Director of Connectivity and Secure Communications (CSC). You will be responsible for the management of satellite-driven CSC programmes/projects within the Directorate in partnership with private and/or public entities, procurement for the space system(s), including the associated programmes related to the ground control segment, when relevant, and support for the development of related (non-generic) satellite technologies and products under the ARTES Core Competitiveness Programme Line. Duties Your tasks and responsibilities will include: the initiation and management of new telecommunications partnership satellite projects with private and/or public entities under the ARTES 4.0 Generic Programme Line, including the consolidation of the programmatic assumptions and results (costs, schedule and risks) resulting from new telecommunications satellite projects in Phase 0/A/B1; procurement for the space system(s) (satellites, ground control segment and launcher services); the implementation of the space system(s) Core Competitiveness activities directly related to the space segment activities under the Departments responsibility; the consolidation of programmatic assumptions under Future Programmes studies (Phase 0/A/B1 activities) in support of the Systems, Strategic Programme Lines and Technology Department; consultation with European operators and prime key accounts regarding their future service portfolios, product lines and future evolutions, in close coordination with the Systems, Strategic Programme Lines and Technology Department; the preparation of the ITT/RFQ packages to industry as well as the preparation and organisation of the related TEBs; the negotiation of space system(s)/satellite phase B2/C/D/E contracts and contract signatures; the design, development, manufacturing and testing of the space system(s), including when relevant, the associated ground segment; the regular involvement of and coordination with the Systems, Strategic Programme Lines and Technology Department for space system(s) activities related to programme/system activities initiated under the Departments responsibility; the space segment risk analysis and identification of risk mitigation activities; the identification of compliance waivers or deviations during phase B2/C/D/E versus space system(s) requirements issued by the Systems, Strategic Programme Lines and Technology Department, for resolution by the corresponding programme/system engineering board; support for the partner operator for the launch and in-orbit commissioning of the space system(s); the monitoring of the first years of operations, for satellite on-board performance and issues, in collaboration with the partner operator and industry; the implementation of hosted payload missions, as well as the related operations management and coordination; the contribution to the Directorate’s internal and external communication for programmes/projects under the Department’s responsibility; the coordination of the functional and integrated support provided by other ESA directorates in collaboration with the Business Control and Programme Management Support Office. You will also be responsible for identifying, assessing, managing and reporting the health and safety risks in your area of responsibility. Technical competencies Multi-disciplinary and comprehensive knowledge of and experience in satellite design, development, verification/testing, launch and in-orbit validation Proven experience of managing space project developmentsKnowledge of industrial costs and schedule aspectsComplex project risk management processesFamiliarity with ESA and EU procurement aspectsKnowledge of space mission operationsInteraction with the European space industry and the European Commission at a high level, including contract negotiationBehavioural competencies Result Orientation Operational Efficiency Fostering Cooperation Relationship Management Continuous Improvement Forward Thinking For more information, please refer to the ESA Core Behavioural Competencies guidebook Education A masters degree in a relevant domain is required for this post. Additional requirements Proven experience of leading, motivating and developing a management team; The ability to provide strategic direction to the individuals and teams within the Department and to relate team objectives to the overall, evolving organisational goals and context; The ability to drive performance and foster cooperation within and across teams throughout the organisation; Demonstrated excellent leadership, relationship management and communication skills, both oral and written; A proven track record of representing the Agency’s interests to external interfaces; Excellent cognitive, analytical, delegation, planning and organisational skills; The ability to anticipate problems, solve complex issues and relate situations to their context; The ability to reach solution-oriented, pragmatic and timely decisions of a high standard and with integrity as well as to support others (team members, upper management, other stakeholders) in this process. People management experience is required, and international experience, including outside your home country, would be an asset, as would experience in diverse functional areas relevant to ESA activities. Mobility is an inherent part of a management role and this position may be subject to rotation. Mobility opportunities may therefore be offered to you as part of the evolution of your career at ESA, starting after approximately five years in this role. Diversity, Equity and Inclusiveness ESA is an equal opportunity employer, committed to achieving diversity within the workforce and creating an inclusive working environment. We therefore welcome applications from all qualified candidates irrespective of gender, sexual orientation, ethnicity, beliefs, age, disability or other characteristics. Applications from women are encouraged. At the Agency we value diversity, and we welcome people with disabilities. Whenever possible, we seek to accommodate individuals with disabilities by providing the necessary support at the workplace. The Human Resources Department can also provide assistance during the recruitment process. If you would like to discuss this further, please contact us via email at contact.human.resources@esa.int. Important Information and Disclaimer Applicants must be eligible to access technology and hardware which is subject to European and US export control regulations and security clearance by their national security administrations. During the recruitment process, the Agency may request applicants to undergo selection tests. Additionally, successful candidates will need to undergo basic screening before appointment, which will be conducted by an external background screening service, in compliance with the European Space Agencys security procedures. Note that ESA is in the process of transitioning to a Matrix setup, which could lead to organisational changes affecting this position. The information published on ESA’s careers website regarding working conditions is correct at the time of publication. It is not intended to be exhaustive and may not address all questions you would have. Nationality and Languages Please note that applications are only considered from nationals of one of the following States: Austria, Belgium, Czechia, Denmark, Estonia, Finland, France, Germany, Greece, Hungary, Ireland, Italy, Luxembourg, the Netherlands, Norway, Poland, Portugal, Romania, Slovenia, Spain, Sweden, Switzerland, the United Kingdom and Canada, Latvia, Lithuania and Slovakia. The working languages of the Agency are English and French. A 