('e6361111-233e-4eb4-8aa8-a3a2f6cf6ee9', '19a39dff-d1cc-4d26-961d-6d8044f114cf', 'Spaceport Infrastructure and CSG Range Renewal Senior Project Manager', 'f2601046-ce81-48ef-8e14-db89efcd7aa6', 'Kourou, FR', 'Location ESA Headquarters, Paris, France with a resident assignment to Guiana Space Center, Kourou, French Guiana. At the end of the 4-year assignment, notwithstanding possible extension of the appointment, a further assignment in an ESA establishment will be considered. Description Spaceport Infrastructure and CSG Range Renewal Senior Project Manager, Launch Range Operations and Representation at CSG, Infrastructure and Value Chain, Directorate of Space Transportation. ESA contributes to the funding of the Guiana Space Centre: in the Directorate of Space Transportation, the Launch Range Operations and Representation at CSG (STS-IR) is responsible for the maintenance, renovation and modernisation of the Spaceport through the ESA/CNES CSG contract. The Core Launch Range Renewal (“CLRR” or CSG-NG) investments, including a new Operations Centre (Centre des Opérations, CDO), will enhance the CSG Ranges capability by improving its efficiency, availability, reliability and flexibility. Successful development of these new systems is crucial for Europes access to space. In that context, you will be responsible for a portfolio of ground segment activities to maintain and modernise the CSG Range, namely the Core Launch Range Renewal project . You will also represent on site, when requested, the Head of the STS-IR Division vis-a-vis ESA partners. Duties You will report directly to the Head of Launch Range Operations and Representation at CSG and, within the framework of ESA/CNES contract, you will be in charge of: monitoring the proper implementation by CNES of the Core Launch Range Renewal project with a specific focus on CDO development, to ensure its compliance with high-level objectives (e.g. flexibility); ensuring the needs of ESA-developed Launchers (Ariane, Vega) and other ESA space transportation projects (SRS, FLPP) are understood and enforced within the CNES projects through close collaboration with the relevant STS project teams; participating in the key milestones/gates for CSG Range investments; coordinating your activities with those of other project engineers/managers from Launch Range Operations and Representation at CSG to guarantee synergies between various projects. Monitoring CLRR project interfaces with other Range parallel activities, participating in the related conﬁguration management boards; participating in CNES/CSG procurement selection boards (REAs, GEO), supporting proactively the concrete implementation of ESA industrial policy requirements, and advising the Head of Launch Range Operations and Representation at CSG on related matters, helping prepare procurement documents; representing, when requested, the Head of Launch Range Operations and Representation at CSG vis-a-vis CNES/CSG on matters related to the implementation of the ESA/CNES contract (CSG Range), and/or to other spaceport infrastructures; supporting and advising the Head of Launch Range Operations and Representation at CSG in the preparation of ESA Member States’ decisions with respect to the CSG (notably at the ESA Council meeting at ministerial level in 2025); reporting regularly to the Head of Launch Range Operations and Representation at CSG (preparing reports as well as recommending steps to be taken); contributing to the progress status reports to the Space Transportation Programme Board; liaising with the Head of the Directorate Representation in Kourou (STS-IRK office) on matters within the latter’s scope of responsibility (e.g. communication, ‘octroi de mer’, etc.). In your day-to-day activities, you will interface with CNES and cooperate with major stakeholders located at the CSG. Technical competencies Demonstrated project(s) experience and proven track record in complex projects management, monitoring of contractsExperience in ground segment(s) design, development(s), integration, testing, qualification, and/or maintenanceExperiences in space industry and agenciesSystem engineering. Command and control systems engineering with knowledge in real-time operations managementLauncher and payload preparation campaign and launch operations managementExcellent ability to exchange at a professional level in French language (fluency)Behavioural competencies Result Orientation Operational Efficiency Fostering Cooperation Relationship Management Continuous Improvement Forward Thinking For more information, please refer to the ESA Core Behavioural Competencies guidebook . Education A masters in an engineering discipline is required for this post. Additional requirements At least 15 years professional experience in space systems, with experience in the space sector, including in project implementation and system engineering; Excellent technical knowledge of operational ground systems; Excellent negotiation and communication skills, with demonstrated experience in complex negotiations, interface definition, interface management, and stakeholder alignment; Excellent cognitive, analytical, planning and organisational skills; Ability to anticipate difficulties and make solution-oriented, pragmatic and timely decisions of high standard and integrity; Ability to anticipate problems, solve complex issues and relate situations to their context; Ability to foster teamwork; Good understanding of the European launchers sector and the relevant issues; Costs/financial, technical and programmatic planning; risk identification and mitigation; Technical expertise in electrical systems (inflight or ground), in command and control systems engineering; Knowledge of space transportation systems, of the CSG (Europe’s Spaceport), its infrastructures (e.g. payload preparation operations), and of spacecraft campaigns and operations. Previous international experience with space agencies and companies is an asset, as well as, knowledge of AGILE development experience in diverse activities relevant to the responsibilities of this position. Diversity, Equity and Inclusiveness ESA is an equal opportunity employer, committed to achieving diversity within the workforce and creating an inclusive working environment. We therefore welcome applications from all qualified candidates irrespective of gender, sexual orientation, ethnicity, beliefs, age, disability or other characteristics. Applications from women are encouraged. At the Agency we value diversity, and we welcome people with disabilities. Whenever possible, we seek to accommodate individuals with disabilities by providing the necessary support at the workplace. The Human Resources Department can also provide assistance during the recruitment process. If you would like to discuss this further, please contact us via email at contact.human.resources@esa.int. Important Information and Disclaimer In principle, recruitment will be within the advertised grade band (A2-A4). However, if the selected candidate has less than four years of relevant professional experience following the completion of the master’s degree, the position may be filled at A1 level. Applicants must be eligible to access information, technology, and hardware which is subject to European or US export control and sanctions regulations & security clearance by their national security administrations. During the recruitment process, the Agency may request applicants to undergo selection tests. Additionally, successful candidates will need to undergo basic screening before appointment, which will be conducted by an external background screening service, in compliance with the European Space Agencys security procedures. Note that ESA is in the process of transitioning to a Matrix setup, which could lead to organisational changes affecting this position. The information published on ESA’s careers website regarding working conditions is correct at the time of publication. It is not intended to be exhaustive and may not address all questions you would have. Nationality and Languages Please note that applications are only considered from nationals of one of the following States: Austria, Belgium, Czechia, Denmark, Estonia, Finland, France, Germany, Greece, Hungary, Ireland, Italy, Luxembourg, the Netherlands, Norway, Poland, Portugal, Romania, Slovenia, Spain, Sweden, Switzerland, the United Kingdom and Canada, Latvia, Lithuania and Slovakia. According to the ESA Convention, the recruitment of staff must take into account an adequate distribution of posts among nationals of the ESA Member States*. When short-listing for an interview, priority will first be given to internal candidates and secondly to external candidates from under-represented Member States*. The working languages of the Agency are English and French. Knowledge of another Member State language would be an asset. *Member States, Associate Members or Cooperating States.', '2025-02-28 00:00:00+00', '2025-03-21 00:00:00+00', '2025-03-03 05:18:00.942956+00', '2025-03-17 06:05:15.359465+00', '2025-03-03 05:18:00.942956+00', 'draft', 'https://jobs.esa.int/job/Kourou-Spaceport-Infrastructure-and-CSG-Range-Renewal-Senior-Project-Manager/1176912801/', null, null, 'Permanent', null),
