('639bd55d-3d25-4593-af3b-01e5dea1f8ad', '20825c1e-e0b6-40a6-988c-87e2e773e3b7', 'ESA Graduate Trainee in Attitude and Orbit Control Systems', 'f2601046-ce81-48ef-8e14-db89efcd7aa6', 'Noordwijk, NL', 'Location ESTEC, Noordwijk, Netherlands Our team and mission The ESA Graduate Trainee (EGT) in Attitude and Orbit Control Systems [AOCS) will be a member of the GNC, AOCS and Pointing Division (TEC-EC) in the Electrical Department of ESA. With more than 40 engineers and researchers, the Division is happy to welcome Y\EGT to contribute to its duties: PROJECT SUPPORT in the field of GNC (Guidance, Navigation and Control), AOCS (Attitude and Orbit Control Systems) and Pointing engineering: Conceptual design studies for future missions GNC/AOCS, in particular in Concurrent Design Facilities (CDF) studies GNC/AOCS design, system analysis and modelling for future and current missions from ESA Directorates, for example Exploration, Space Transportation, Earth Observation, Science, Telecommunication and Navigation as well as In-Orbit Demonstration missions TECHNOLOGY DEVELOPMENT Definition of technology development requirements for space missions and ESA technology programmes covering both long and short-term needs; Mission enabling R/D activities for AOCS and Pointing Systems (competitive Building Blocks, high accuracy pointing, autonomy, nanosat ADCS, …); Mission enabling R/D activities for GNC (interplanetary cruise, aero assistance, precision landing, ascent, rendezvous and docking, re-entry, formation flying and drag free systems, …); Technology development of AOCS sensors and actuators (star trackers, sun and Earth sensors, gyroscopes, accelerometers and Inertial Measurement Units, magnetometers, magnetic torquers, …); Fostering the utilisation of advanced control, estimation, validation, verification and optimisation techniques. LABORATORY WORK Evaluation and prototyping of GNC/AOCS sensors and actuators Evaluation and prototyping of new GNC techniques (GNC Rendezvous, Approach and Landing, Optical Navigation) Evaluation and prototyping of new AOCS, pointing systems and associated subsystem hardware [Mostly for smallsat and nanosat AOCS and high-performance pointing] You are encouraged to visit the ESA website: http://www.esa.int and websites of the main conferences (co-)organised by the GNC, AOCS & Pointing Division: ESA GNC Conference, ICATT and ADCSS. Field(s) of activity/research for the traineeship You will contribute to implement and upgrade the AOCS simulation, analysis, design, and verification facilities and to perform laboratory activities in the field of the AOCS and Pointing, amongst the following ones: AOCS definition and validation De-orbiting control strategy and AOCS mode definition for Low Earth Orbit satellite AOCS Verification and Validation using Model Based engineering resources and process, with focus on automated code generation Development and assessment of autonomy functions for future AOCS systems Performance and robustness characterisation of new AOCS sensors Hardware-in-the-loop (HIL) experiments for rapid AOCS prototyping and verification, for example in the AOCS flatsat (avionics bench level for AOCS verification) or the AOCS air-bearing facility for nanosat ADCS test, both at ESTEC Contribution to the AOCS simulator modelling library You will perform the following tasks: From mission or system-level requirements, develop an understanding of the implications on the derived requirements and architectures at AOCS system level Develop or enhance the existing AOCS simulation environments, implementing mission specific models of dynamics, kinematics and environment as well as AOCS sensor and actuator suites Contribute to the AOCS analysis and design of on-board algorithms, AOCS units trade-offs (as part of Concurrent Design Facility studies), and AOCS tools development (for AOCS sizing, performance analysis, controller & estimation tuning) Implement the AOCS algorithms on a target processor via auto-coding in order to assess real-time performance and computational loads Perform integration and verification in a Processor-in-the-loop (PIL) testing facility, using the test facilities of the Division Setup Hardware-in-the-loop (HIL) experiments for rapid prototyping and verification. In this task, the trainee shall integrate the available hardware models of AOCS units and/or embed the AOCS algorithms, and all needed interfaces into the adequate Laboratory Facility, for example for example in the AOCS flatsat (avionics bench level for AOCS verification) or the AOCS air-bearing facility for nanosat ADCS test, typically in support of an ESA mission under development Perform end-to-end verification, validation, and closed-loop testing of AOCS systems on the Division facilities and develop data analysis tools for the characterisation and testing of hardware units Document the performed activities in dedicated technical reports and communicate results This ESA Graduate Traineeship will provide the selected candidate with a solid AOCS experience, technical skills and hands-on know-how. Technical competencies Knowledge of relevant technical/functional domainsRelevant experience gained during internships, project work and/or extracurricular or other activitiesGeneral knowledge of the space sector and relevant activitiesKnowledge of ESA and its programmes/projectsBehavioural competencies Result Orientation Operational Efficiency Fostering Cooperation Relationship Management Continuous Improvement Forward Thinking For more information, please refer to ESA Core Behavioural Competencies guidebook Education You should have just completed, or be in the final year of your master’ s degree in control, aerospace or electrical engineering. Additional requirements You should have good interpersonal and communication skills and should be able to work in a multicultural environment, both independently and as part of a team. Previous experience of working in international teams can be considered an asset. Your motivation, overall professional perspective and career goals will also be explored during the later stages of the selection process. In complement of Education degree, a specific competence and experience in the following disciplines or tools would be required: Mathematical modelling and simulation Control theory Data fusion and estimation Matlab/Simulink and Python Hands-on activities in AOCS Laboratory facilities Diversity, Equity and Inclusiveness ESA is an equal opportunity employer, committed to achieving diversity within the workforce and creating an inclusive working environment. We therefore welcome applications from all qualified candidates irrespective of gender, sexual orientation, ethnicity, beliefs, age, disability or other characteristics. Applications from women are encouraged. At the Agency we value diversity, and we welcome people with disabilities. Whenever possible, we seek to accommodate individuals with disabilities by providing the necessary support at the workplace. The Human Resources Department can also provide assistance during the recruitment process. If you would like to discuss this further, please contact us via email at contact.human.resources@esa.int. Important Information and Disclaimer During the recruitment process, the Agency may request applicants to undergo selection tests. Additionally, successful candidates will need to undergo basic screening before appointment, which will be conducted by an external background screening service, in compliance with the European Space Agencys security procedures. The information published on ESA’s careers website regarding working conditions is correct at the time of publication. It is not intended to be exhaustive and may not address all questions you would have. Nationality and Languages Please note that applications can only be considered from nationals of one of the following States: Austria, Belgium, Czechia, Denmark, Estonia, Finland, France, Germany, Greece, Hungary, Ireland, Italy, Luxembourg, the Netherlands, Norway, Poland, Portugal, Romania, Slovenia, Spain, Sweden, Switzerland, and the United Kingdom. Nationals from Latvia, Lithuania and Slovakia as Associate Member States, or Canada as a Cooperating State, can apply as well as those from Bulgaria, Croatia, Cyprus and Malta as European Cooperating States (ECS). According to the ESA Convention, the recruitment of staff must take into account an adequate distribution of posts among nationals of the ESA Member States*. When short-listing for an interview, priority will be given to external candidates from under-represented Member States*. The working languages of the Agency are English and French. A good knowledge of one of these is required. Knowledge of another Member State language would be an asset. *Member States, Associate Members or Cooperating States.', '2025-02-01 00:00:00+00', '2025-02-28 00:00:00+00', '2025-02-28 10:15:59.692158+00', '2025-03-17 06:05:15.359465+00', '2025-02-28 10:15:59.692158+00', 'draft', 'https://jobs.esa.int/job/Noordwijk-ESA-Graduate-Trainee-in-Attitude-and-Orbit-Control-Systems/1165612401/', null, null, null, null),
