('18173aa2-1c29-4751-ba3e-e432c69efb57', 'Investment Analytics Dashboard', 'Track investment activities in the space industry including: funding rounds, mergers & acquisitions, public offerings, and market trends. Visualization of investment data and market analysis.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-07 08:28:34.970016+00', '0', '0', '0', '2'),
 ('312b3b38-1ba7-40b5-9d5d-1c3784bdb065', 'Regulatory Updates Tracker', 'Monitor and summarize regulatory changes affecting the space industry across different jurisdictions. Includes compliance requirements and policy updates.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-07 08:28:37.168381+00', '0', '0', '0', '2'),
 ('429878de-1423-4f9d-9f78-b0b1b38676e0', 'Industry Collaboration Hub', 'Platform for space industry professionals to connect, share insights, and discuss developments. Features: expert directories, discussion forums, and networking opportunities.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-07 08:28:33.751204+00', '0', '0', '0', '3'),
 ('5dc66c41-fabc-4db9-82f4-c872dabadc9d', 'Job Board and Tracking System', 'Automated job aggregation system from space industry companies. Features: automated job posting collection, AI-powered job categorization, skill matching, and email alerts for new positions matching user preferences.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-01-29 04:30:55.791172+00', '0', '0', '0', '6'),
 ('5fb8735a-22ae-4b96-ad91-2ff8d6f705d9', 'Company Database Launch', 'Comprehensive database of space industry companies including: company profiles, funding history, key personnel, technology focus areas, and market segments. Integration with news feed for company-specific updates.', 'in_progress', '2024-12-11 09:42:02.526472+00', '2025-02-11 04:37:17.195279+00', '0', '0', '0', '4'),
 ('b403a651-278f-4b12-846a-9ce4fb48b943', 'Daily Space Industry Newsletter', 'AI-curated daily digest of space industry news, including: company updates, launch schedules, funding rounds, contract awards, and technology breakthroughs. Automated summarization with key highlights.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-20 09:48:18.954386+00', '0', '0', '0', '4'),
 ('b856bf6a-6050-476f-85d7-9d15a5698df1', 'Launch Calendar Integration', 'Interactive calendar showing upcoming space launches, satellite deployments, and major industry events. Features: notifications, countdown timers, and mission details.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-03-19 08:45:19.889741+00', '0', '0', '0', '3'),
 ('c74c0215-8b7c-4f88-87a2-0f612a259cc6', 'Technology Trend Analysis', 'AI-powered analysis of emerging technologies and trends in the space industry. Track patent filings, research papers, and technical developments.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-07 08:28:31.851668+00', '0', '0', '0', '3'),
 ('ce8a676e-fc04-4c0e-8fea-50bf714a7b8c', 'Personalized Content Feed', 'Customizable news and updates feed based on user preferences. Features: company following, category filtering, source selection, and AI-powered content recommendations.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-03-19 08:45:18.242692+00', '0', '0', '0', '4'),
 ('f67be76f-ef48-4f9b-87ba-38dcad664ab5', 'Company Following System', 'Enable users to follow specific companies and receive targeted updates including: press releases, job postings, contract awards, and major announcements.', 'planned', '2024-12-11 09:42:02.526472+00', '2025-02-11 04:37:18.781666+00', '0', '0', '0', '3');
