('17455329-8894-46a0-a1ab-42744ec41493', 'basic@testing.com', 'Basic', 'Tester', '_', null, null, '2025-04-01 16:05:53.954122+00', '2025-04-02 04:35:41.97692+00', '2025-04-01 16:05:53.954122+00', null, null, '0', '0', 'basic', 'user', 'false', 'false', 'true', null, 'hobbyist');
INSERT INTO "public"."user_profiles" ("email", "given_name", "surname", "username", "dob", "gender_id", "created_at", "updated_at", "last_seen", "avatar", "introduction", "followed_count", "followers_count", "id", "plan", "role") VALUES
	('mariaclarahlourenco@gmail.com', 'Maria', 'Lourenço', 'Maria', '2000-08-11', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'maria-heringer.jpg',  'I''m a brazilian girl who loves to travel and meet new people! Also trying to be an astronomer (I''m still an undergraduate student!) and discover the wonders of this universe!', 0, 0, '65ca5a40-5a67-4dd8-b5c3-f77a24c89243', 'free', 'user'),
	('shwetakk6@gmail.com', 'Shweta', 'Kulkarni', 'Shweta', '1995-11-16', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'shweta-kulkarni.jpg',  NULL, 1, 1, 'e1bf12c6-aad4-4905-bda2-127c027504a3', 'free', 'user'),
	('rw47@st-andrews.ac.uk', 'Rose', 'Waugh', 'Rose', '1995-01-17', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'rose-waugh.jpg',  'Final year PhD student at the university of St. Andrews in Scotland, researching the magnetic fields of young suns.', 0, 0, 'b4eb9ac1-d034-4c74-a372-53917c443f24', 'free', 'user'),
	('marcosvaldes@vis-sns.com', 'Marcos', 'Valdes', 'Marcos', '1978-07-22', 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'marcos-valdes.jpg',  'I am an astrophysicist, science communicator and one of the founding partners of Virtual Immersions in Science (VIS), where I have been Scientific Director since the companys foundation in 2019, and CEO since March 2021. VIS, the first Spinoff in the century-long history of Scuola Normale Superiore di Pisa, specializes in the production of multimedia materials for science popularization based on innovative digital systems. I work on both classic 2D documentaries of different types and lengths, and educational and engaging immersive 3D applications in virtual or augmented reality. My main expertises are theoretical cosmology and science communication through traditional and new media.', 0, 0, 'bb85b812-8a43-4e53-b510-2f34e8a4ee86', 'free', 'user'),
	('aricorte@ov.ufrj.br', 'Arianna', 'Cortesi', 'Arianna', '1982-02-16', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'arianna-cortesi.jpg',  'I am an Italian astronomer working at the Federal University of Rio de Janeiro (UFRJ, Brazil). I research galaxy formation and evolution, with a special focus in lenticular galaxies. I also partecipate to several outreach projects, focused in inclusion, to promote peace and justice, in collaboration with indigenous communities, afrobrasilian cultural center and social projects in favelas (slums) of Rio de Janeiro.  I am part of the Brazilian NOC.', 0, 0, '563f1e13-a548-4268-9c5c-dabca7751ae2', 'free', 'user'),
	('kajrekarpallavi@gmail.com', 'Pallavi', 'Kajrekar', 'Pallavi', '2000-06-22', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'pallavi-kajrekar.jpg',  'I am an experimental molecular astrophysicist. I expertise in analytical and physical chemistry , Interstellar Spectroscopy and general & molecular astrophysics. I recieved my academic honors in the field of astronomy and physical chemistry. I am also a screenplay writer and a surreal artist.', 0, 0, '4849592e-6e56-4107-b91e-23c5b0e3a120', 'free', 'user'),
	('madiazteo@gmail.com', 'Alejandra', 'Díaz', 'Alejandra', '1997-11-12', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'alejandra-diaz.jpg',  'Hi! I''m Alejandra Díaz, an early-career astrophysicist from Spain. I have a degree in Physics and a Masters degree in Astrophysics from the Autónoma University of Madrid (UAM). After finishing my studies I wanted some research experience outside academia, so I did a traineeship with the European Space Agency (ESA), focusing on star-formation. Following that, I was interested in using astronomy to make the world a better place, so I did a research fellowship with IAU’s Office of Astronomy for Development (OAD). I am currently in Finland pursuing a PHD in Turku University, my research focusing on neutron stars.', 0, 0, '55a97a96-ac87-4e6c-aa43-033162f7c318', 'free', 'user'),
	('forsonalbert@gmail.com', 'Albert', 'Forson', 'Albert', '1986-07-15', 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'albert-forson.jpg',  'Albert is an electrical and electronic engineer and is currently a MPhil.  Radio Astronomy Instrumentation research student at the University of Mauritius, working on developing an array of small parabolic dish antennas as a prototype instrument for the SKA-Mauritius project. He is the National Education Astronomy Coordinator for Ghana and Astronomy Education outreach project-PRAGSAC coordinator. His dream is to build the next generation of telescopes and observation techniques to help understand the universe better than we do today. He holds the belief that ‘’There is nothing impossible until you make the impossible attempt.’’', 0, 0, '53aeb7f7-048b-4783-b86b-31770d6533c6', 'free', 'user'),
	('catherinebeehag@gmail.com', 'Catherine', 'Beehag', 'Catherine', '1985-02-11', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'catherine-beehag.jpg',  'I am a high school physics teacher in rural Australia with a passion for astronomy. I work to inspire young people to take up STEM and show them the endless possibilities a career in science can bring. I am also currently undertaking my PhD in astrophysics, researching binary star systems and the evolution of their orbits.', 0, 0, '387d7f68-4288-466a-8744-ef7b3844f780', 'free', 'user'),
	('drewmacgibbon@gmail.com', 'Drew', 'MacGibbon', 'Mac', '1993-05-02', 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'drew-macgibbon.jpg', 'Im a software engineer with a passion for space and the unknown and the lead developer for AstronEra. I have a background in business and love to get my hands dirty building products that people find useful. Feel free to reach out if you have any ideas how to improve AstronEra', 3, 4, 'e8976b16-02a9-4595-a8a9-6457548eec12', 'free', 'user'),
	('arnab@students.iisertirupati.ac.in', 'Arnab', 'Lahiry', 'Arnab', '2001-03-28', 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'arnab-lahiry.jpg',  'I''m a final year MS student from the Indian Institute of Science Education and Research Tirupati. I am currently pursuing research in computational astrophysics and cosmology and machine learning applications in the field. I want planning to pursue a PhD in this field and grow my career in scientific research!', 0, 0, 'e763cc34-88a1-4776-9e95-fbb3de26e921', 'free', 'user'),
	('khiradivipul@gmail.com', 'Vipul', 'Khiradi', 'Vipul', NULL, 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'vipul-khiradi.jpg',  'I have been interested in astronomy since my childhood because of my grandmothers stories about stars & constellations. I have become astroguide so that I can introduce astronomy among my tribal community. As a astroguide, I would like to use astronomy for the development of my community', 0, 0, '142c59a9-402b-4e11-9c28-7f8f4c16f218', 'free', 'user'),
	('sagarbodhare424@gmail.com', 'Sagar', 'Bodhare', 'Sagar', NULL, 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'sagar-bodhre.jpg',  'I am very curious about night sky and this attracted me towards astronomy. I love to give information about this universe to people who are unknown about the universe. As a astroguide, I look forward to popularize astronomy among tribal people.', 0, 0, '2b76a033-af54-43d3-b749-2d9d48161c6c', 'free', 'user'),
	('namavalvi557@gmail.com', 'Nama', 'Valvi', 'Nama', NULL, 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'nama-valvi.jpg',  'Since I am very enthusiastic about space and this made me close to astronomy. Also I like to accumulate information about space. As a astroguide, I want to create interest in astronomy among tribal people.', 0, 0, '5aed8ee2-27e8-4deb-a576-e4bed07657f0', 'free', 'user'),
	('jagtapvinod095@gmail.com', 'Vinod', 'Jagtap', 'Vinod', NULL, 1, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'vinod-jagtap.jpg',  'I am interested in studying astronomy because it always introduce new things to me. I want to guide people who doesn''t know much more about astronomy.  As a astroguide, I would like   to tell people that what astronomy is about? and also the importance of astronomy sector.', 0, 0, 'd5db81a9-4a30-4c2e-9e46-2e5b2913377b', 'free', 'user'),
	('chaudharichhakuli101@gmail.com', 'Chhakuli', 'Chaudhari', 'Chhakuli', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'chhakuli-choudhari.jpg',  NULL, 0, 0, '7f6e9b63-ccb3-4036-8168-5b41fc186611', 'free', 'user'),
	('astardesai704@gmail.com', 'Estar', 'Desai', 'Estar', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'estar-desai.jpg',  'Astronomy was a subject I was very fond of when the project was done, I found more information from it that I searched for more books, because I like very much. This is my favourite subject.Because I like to explain and I can explain. And I like and like to share information about Astronomy. because if all the information is provided till people the India will also progress like other countries. I want to give information about astronomy to tribal people and tribal students. what is Astronomy and whats are its plan.', 0, 0, '1f6be1c0-2833-4ca1-a385-e0149269be70', 'free', 'user'),
	('sharmilakuwar01@gmail.com', 'Sharmila', 'Kuwar', 'Sharmila', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'sharmila-kuwar.jpg',  NULL, 0, 0, '284e5869-c2ee-43e0-a113-99f2353b1b23', 'free', 'user'),
	('chaurekavita119@gmail.com', 'Kavita', 'Chaure', 'Kavita', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'kavita-chaure.jpg',  'introduction: I like astronomy as it has very deep and interesting study. People have so many misconceptions about astronomy. And as a astroguide I want to remove all this misconceptions and superstitions from mind of people who have beliefs in superstition.', 0, 0, '44dfbd04-abc4-493f-bc14-2f7ac5c53161', 'free', 'user'),
	('komalwagh962@gmail.com', 'Komal', 'Wagh', 'Komal', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'komal-wagh.jpg',  NULL, 0, 0, '93701523-5db1-437f-97f4-754c357fd217', 'free', 'user'),
	('nehagavali62@gmail.com', 'Neha', 'Gavli', 'Neha', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'neha-gavli.jpg',  'I love to study everything beyond our planet Earth and astronomy studies the same. This encouraged me to become an astroguide. As a astroguide , I would like to discuss about space and its mysteries.', 0, 0, 'c04a9bef-d476-494a-8dd8-02075ef3ebe9', 'free', 'user'),
	('rashmachaure8@gmail.com', 'Reshma', 'Gulabchaure', 'Reshma', NULL, 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'reshma-chaure.jpg',  'I like astronomy because it is vast study. Tribal people are unknown with astronomy and as a astroguide I want to introduce astronomy between them.', 0, 0, '6c5accab-8741-4fc6-adf8-0c2cc9ffb4b7', 'free', 'user'),
	('nataliea.lowson@usq.edu.au', 'Nataliea', 'Lowson', 'Nataliea', '1994-12-23', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'nataliea-lowson.jpg',  'Hi! I’m an astronomer, science communicator and filmmaker. Currently undertaking a PhD in Astrophysics at the University of Southern Queensland, my research focuses on exoplanet atmospheres characterisation – classifying the atmospheres of distant worlds outside of our Solar System. From looking at these atmospheres, we can uncover what it’s made of, weather', 0, 0, '4b8b84ea-92b5-4a8d-a848-f5665174cd57', 'free', 'user'),
	('ruchirahuchgol007@gmail.com', 'Ruchira', 'Huchgol', 'Ruchira', '2001-06-07', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'ruchira-huchgol.jpg',  'Alumni from Mars Settlement and Exploration Program 22 as well as Mars Science and Engineering Program 22 from MarsU.USA. Program lead for the  Lonar Analog Expedition Program 22 a low fidelity educational analog mission. Winner of Multidisciplinary Design thinking competition for Sustainable Lunar Village by Moon village association and APOSA. Participant of the first Mars Analogue Site Expedition. Analog Astronaut from habitat Marte mission 89. Co-Founder of Astrocapsule.', 0, 0, '72b03fa1-4430-4c07-bb89-991285918f22', 'free', 'user'),
	('becky.russwurm@gmail.com', 'Rebekah', 'Russwurm', 'Rebekah', '1989-08-22', 2, '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', '2023-08-11 16:49:09.163+00', 'rebekah-russwurm.jpg',  'I am a business developer and project manager dedicated to advancing space-faring companies toward success. I have over a decade of experience in business management and am now able to combine my expertise with my passion for space. I have a Masters in Space Science from the International Space University providing me knowledge in space engineering, entrepreneurship, science, humanities and more! I am an active Citizen Scientist and collaborate on many projects encouraging those without technical backgrounds to get involved in astronomy! I am also a big supporter of women in STEAM education programs and created a program for Canadian schools that involves citizen science as a part of the curriculum learning about the solar system.', 0, 0, '3eb552af-3edf-4728-9e15-770a678b7e0c', 'free', 'user'),
	('ridhimadogra900@gmail.com', 'Ridhima', 'Dogra', 'Ridhima', NULL, 2, '2024-03-03 10:38:27.526743+00', '2024-03-03 10:38:27.526743+00', '2024-03-03 10:38:27.526743+00', 'ridhima-dogra.jpg',  'With an obsession with the moon and the night sky since a young age, my interests lie in astronomy, sports, going on adventures and finding new activities to do!', 0, 0, 'a9ef08bb-3ced-4946-87ed-1b5545157e09', 'free', 'user'),
	('neilaroongogoi@gmail.com', 'Neil', 'Aroon Gogoi', 'Neil', NULL, 1, '2024-03-03 10:38:38.086267+00', '2024-03-03 10:38:38.086267+00', '2024-03-03 10:38:38.086267+00', 'neil-aroon-gogoi.jpg',  'Being a fast learner who tries to do everything as effectively as he can, astronomy interests me as a way to feel closer to the stars and the unimaginary gigantic universe!', 0, 0, '4487fa8f-09dc-45df-9270-779effedcff5', 'free', 'user'),
	('bhotiaankit@gmail.com', 'Ankit', 'Bhutia', 'Ankit', NULL, 1, '2024-03-03 10:38:45.164336+00', '2024-03-03 10:38:45.164336+00', '2024-03-03 10:38:45.164336+00', 'ankit-bhutia.jpg',  '’Astronomy’ is a beautiful word and it’s interesting planets, stars, moons and galaxies make me obsessed with it.', 0, 0, '35f8a4a0-40b8-49fc-970e-bfe0931a0d9e', 'free', 'user'),
